import React, {useEffect, useState} from "react";

    const Events = () => {
        const[notes, setNotes] = useState([{  //constante notes, fonstion setNotes
            title:'',
            content:''
        }]) 

        useEffect(()=>{
            fetch("/notes").then(res=>{
                if(res.ok){
                    return res.json()
                }
            }).then(jsonRes => setNotes(jsonRes));
        })
        return <div>
            <h1>Évènements</h1>
            {notes.map(note =>
            <div>
                <h1>{note.title}</h1>
                <p>{note.content}</p>
            </div>
            )}
        </div>
        
        }

export default Events;
